import React, { useState } from "react";
import { Link } from "react-router-dom";
import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';
import './HomePage.css';

const HomePage = () => {
  // State for filter options
  const [location, setLocation] = useState("");
  const [eventType, setEventType] = useState("Marriage");
  const [capacity, setCapacity] = useState("");
  const [catering, setCatering] = useState(false);
  const [decoration, setDecoration] = useState(false);

  // Handle filter changes
  const handleLocationChange = (e) => {
    setLocation(e.target.value);
  };

  const handleEventTypeChange = (e) => {
    setEventType(e.target.value);
  };

  const handleCapacityChange = (e) => {
    setCapacity(e.target.value);
  };

  const handleCateringChange = (e) => {
    setCatering(e.target.checked);
  };

  const handleDecorationChange = (e) => {
    setDecoration(e.target.checked);
  };

  // Google Maps configuration
  const mapContainerStyle = {
    width: '100%',
    height: '400px',
  };

  const center = {
    lat: 28.6448, // Approximate center of India
    lng: 77.216721, // Approximate center of India
  };

  const venues = [
    { id: 1, name: "Mahal 1", lat: 28.6448, lng: 77.216721 },
    { id: 2, name: "Mahal 2", lat: 28.6578, lng: 77.208721 },
    // Add more venues with lat, lng data
  ];

  return (
    <div className="homepage">
      {/* Hero Section */}
      <div className="hero-section">
        <div className="hero-content">
          <h1>Discover Your Perfect Venue</h1>
          <p>Effortlessly book the ideal mahal for every celebration!</p>
          <Link to="/login" className="hero-btn primary-btn">Get Started</Link>
        </div>
      </div>

      {/* Filter Section */}
      <section className="filter-section">
        <h2>Find Your Ideal Wedding Mahal</h2>
        <form className="filter-form">
          <div className="filter-option">
            <label htmlFor="location">Location:</label>
            <select id="location" value={location} onChange={handleLocationChange}>
              <option value="">Select Location</option>
              <option value="Delhi">Delhi</option>
              <option value="Mumbai">Mumbai</option>
              <option value="Bangalore">Bangalore</option>
              <option value="Chennai">Chennai</option>
            </select>
          </div>

          <div className="filter-option">
            <label htmlFor="event-type">Event Type:</label>
            <select id="event-type" value={eventType} onChange={handleEventTypeChange}>
              <option value="Marriage">Marriage</option>
              <option value="Reception">Reception</option>
              <option value="Engagement">Engagement</option>
              <option value="Birthday">Birthday</option>
            </select>
          </div>

          <div className="filter-option">
            <label htmlFor="capacity">Capacity:</label>
            <select id="capacity" value={capacity} onChange={handleCapacityChange}>
              <option value="">Select Capacity</option>
              <option value="100">Up to 100</option>
              <option value="200">Up to 200</option>
              <option value="500">Up to 500</option>
              <option value="1000">Up to 1000</option>
            </select>
          </div>

          <div className="filter-option">
            <label htmlFor="catering">Catering Service:</label>
            <input
              type="checkbox"
              id="catering"
              checked={catering}
              onChange={handleCateringChange}
            />
            <label htmlFor="catering">Available</label>
          </div>

          <div className="filter-option">
            <label htmlFor="decoration">Decoration:</label>
            <input
              type="checkbox"
              id="decoration"
              checked={decoration}
              onChange={handleDecorationChange}
            />
            <label htmlFor="decoration">Available</label>
          </div>

          <button type="submit" className="filter-btn">Apply Filters</button>
        </form>
      </section>

      {/* Map Section */}
      <section className="map-section">
        <h2>Wedding Mahal Locations</h2>
        <LoadScript googleMapsApiKey="YOUR_GOOGLE_MAPS_API_KEY">
          <GoogleMap
            mapContainerStyle={mapContainerStyle}
            center={center}
            zoom={10}
          >
            {venues.map((venue) => (
              <Marker
                key={venue.id}
                position={{ lat: venue.lat, lng: venue.lng }}
                label={venue.name}
              />
            ))}
          </GoogleMap>
        </LoadScript>
      </section>

      {/* Footer Section */}
      <footer className="homepage-footer">
        <p>&copy; 2024 Mahal Booking. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default HomePage;
